import React, { Component } from 'react'
import Cwbstation from './Cwbstation'
const makeStation=(sta)=>{
    var output=[];
    for(let i=0;i<sta.length;++i)
        output.push(<Cwbstation station={sta} />)
    return output;
}
export class Cwbdata extends Component {
    constructor(props) {
        super(props);
        this.stationData=props.stations
      };
    render() {
        return (
            <div>
                {this.state.cwbFetched==true?
                makeStation(this.stationData.records.location):
                (<div>Fetching Data</div>)
            }
            </div>
        )
    }
}
export default Cwbdata
